import React from 'react';
import Navbar from './Component/NavBar/Navbar';
import HeroCaption from './Component/HeroCaption/HeroCaption';
import Card from './Component/Card/Card';
import './App.css';
function App() {
  return (
    <div className="App">
      <Navbar />
      <HeroCaption />
      <Card imgUrl={"https://cdn-icons-png.flaticon.com/512/1159/1159725.png"} title={"UI/UX Design"} des={"Free resource that will help nderstand thecv designc process and improve theroi nderstand the design process andisei impro are of vquality."}/>
    </div>
  );
}

export default App;
